// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title ModelRegistry
 * @dev Registry for AI/ML models with tokenized usage and fee distribution
 */
contract ModelRegistry is Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;
    
    IERC20 public dcnetToken;
    
    struct Model {
        uint256 id;
        address creator;
        string name;
        string description;
        string modelType;
        string greenfieldHash;
        uint256 pricePerUse;
        bool isFederatedModel;
        bool isActive;
        uint256 usageCount;
        uint256 totalRevenue;
        string[] tags;
        uint256 createdAt;
    }
    
    struct ModelUsage {
        uint256 usageId;
        uint256 modelId;
        address user;
        uint256 timestamp;
        uint256 fee;
        bool success;
    }
    
    // Storage
    Counters.Counter private _modelIdCounter;
    Counters.Counter private _usageIdCounter;
    mapping(uint256 => Model) public models;
    mapping(address => uint256[]) public creatorModels;
    mapping(uint256 => ModelUsage[]) public modelUsages;
    
    // Revenue sharing
    uint256 public platformFeePercentage = 10; // 10% platform fee
    
    // Events
    event ModelRegistered(
        uint256 indexed modelId,
        address indexed creator,
        string name,
        string modelType,
        string greenfieldHash,
        uint256 pricePerUse,
        uint256 timestamp
    );
    
    event ModelUsed(
        uint256 indexed modelId,
        uint256 indexed usageId,
        address indexed user,
        uint256 fee,
        bool success,
        uint256 timestamp
    );
    
    event ModelUpdated(
        uint256 indexed modelId,
        string name,
        string description,
        uint256 pricePerUse,
        bool isActive,
        uint256 timestamp
    );
    
    modifier validModelId(uint256 modelId) {
        require(modelId > 0 && modelId <= _modelIdCounter.current(), "Invalid model ID");
        _;
    }
    
    constructor(address _dcnetToken) {
        dcnetToken = IERC20(_dcnetToken);
    }
    
    /**
     * @dev Register a new AI/ML model
     */
    function registerModel(
        string calldata name,
        string calldata description,
        string calldata modelType,
        string calldata greenfieldHash,
        uint256 pricePerUse,
        bool isFederatedModel,
        string[] calldata tags
    ) external returns (uint256) {
        require(bytes(name).length > 0, "Name cannot be empty");
        require(bytes(greenfieldHash).length > 0, "Greenfield hash cannot be empty");
        require(pricePerUse > 0, "Price must be greater than 0");
        
        _modelIdCounter.increment();
        uint256 newModelId = _modelIdCounter.current();
        
        Model storage model = models[newModelId];
        model.id = newModelId;
        model.creator = msg.sender;
        model.name = name;
        model.description = description;
        model.modelType = modelType;
        model.greenfieldHash = greenfieldHash;
        model.pricePerUse = pricePerUse;
        model.isFederatedModel = isFederatedModel;
        model.isActive = true;
        model.usageCount = 0;
        model.totalRevenue = 0;
        model.tags = tags;
        model.createdAt = block.timestamp;
        
        creatorModels[msg.sender].push(newModelId);
        
        emit ModelRegistered(
            newModelId,
            msg.sender,
            name,
            modelType,
            greenfieldHash,
            pricePerUse,
            block.timestamp
        );
        
        return newModelId;
    }
    
    /**
     * @dev Use a model and pay the usage fee
     */
    function useModel(uint256 modelId) external validModelId(modelId) nonReentrant returns (uint256) {
        Model storage model = models[modelId];
        require(model.isActive, "Model is not active");
        
        uint256 fee = model.pricePerUse;
        
        // Transfer DCNET tokens for model usage
        bool transferSuccess = dcnetToken.transferFrom(msg.sender, address(this), fee);
        require(transferSuccess, "Token transfer failed");
        
        // Create usage record
        _usageIdCounter.increment();
        uint256 usageId = _usageIdCounter.current();
        
        ModelUsage memory usage = ModelUsage({
            usageId: usageId,
            modelId: modelId,
            user: msg.sender,
            timestamp: block.timestamp,
            fee: fee,
            success: true
        });
        
        modelUsages[modelId].push(usage);
        
        // Update model statistics
        model.usageCount++;
        model.totalRevenue += fee;
        
        // Distribute revenue
        uint256 platformFee = (fee * platformFeePercentage) / 100;
        uint256 creatorFee = fee - platformFee;
        
        // Transfer creator fee
        dcnetToken.transfer(model.creator, creatorFee);
        
        emit ModelUsed(
            modelId,
            usageId,
            msg.sender,
            fee,
            true,
            block.timestamp
        );
        
        return usageId;
    }
    
    /**
     * @dev Update model details (only model creator)
     */
    function updateModel(
        uint256 modelId,
        string calldata name,
        string calldata description,
        uint256 pricePerUse,
        bool isActive
    ) external validModelId(modelId) {
        Model storage model = models[modelId];
        require(model.creator == msg.sender, "Only creator can update model");
        
        if (bytes(name).length > 0) {
            model.name = name;
        }
        
        model.description = description;
        
        if (pricePerUse > 0) {
            model.pricePerUse = pricePerUse;
        }
        
        model.isActive = isActive;
        
        emit ModelUpdated(
            modelId,
            name,
            description,
            pricePerUse,
            isActive,
            block.timestamp
        );
    }
    
    /**
     * @dev Get model details
     */
    function getModel(uint256 modelId) external view validModelId(modelId) returns (
        address creator,
        string memory name,
        string memory description,
        string memory modelType,
        string memory greenfieldHash,
        uint256 pricePerUse,
        bool isFederatedModel,
        bool isActive,
        uint256 usageCount,
        uint256 totalRevenue,
        string[] memory tags,
        uint256 createdAt
    ) {
        Model storage model = models[modelId];
        return (
            model.creator,
            model.name,
            model.description,
            model.modelType,
            model.greenfieldHash,
            model.pricePerUse,
            model.isFederatedModel,
            model.isActive,
            model.usageCount,
            model.totalRevenue,
            model.tags,
            model.createdAt
        );
    }
    
    /**
     * @dev Get creator's models
     */
    function getCreatorModels(address creator) external view returns (uint256[] memory) {
        return creatorModels[creator];
    }
    
    /**
     * @dev Update platform fee percentage (only owner)
     */
    function updatePlatformFeePercentage(uint256 _platformFeePercentage) external onlyOwner {
        require(_platformFeePercentage <= 30, "Platform fee too high"); // Max 30%
        platformFeePercentage = _platformFeePercentage;
    }
    
    /**
     * @dev Withdraw platform fees (only owner)
     */
    function withdrawPlatformFees() external onlyOwner {
        uint256 balance = dcnetToken.balanceOf(address(this));
        require(balance > 0, "No fees to withdraw");
        
        dcnetToken.transfer(owner(), balance);
    }
    
    /**
     * @dev Get registry statistics
     */
    function getRegistryStatistics() external view returns (
        uint256 totalModels,
        uint256 activeModels,
        uint256 totalModelUsages,
        uint256 totalRevenue
    ) {
        uint256 active = 0;
        uint256 revenue = 0;
        
        for (uint256 i = 1; i <= _modelIdCounter.current(); i++) {
            if (models[i].isActive) {
                active++;
            }
            revenue += models[i].totalRevenue;
        }
        
        return (
            _modelIdCounter.current(),
            active,
            _usageIdCounter.current(),
            revenue
        );
    }
}
